import React from 'react'
import { useState, useEffect } from 'react';

function Loader() {

    const [loading, setloading] = useState(false);

    useEffect(() => {
        setTimeout(() => {
            loading.style.display = "none";
        }, 2000)

        const linkreload = (linkclass) => {
            let link = linkclass
            setloading(link);
            console.log(link);

            if(link === "/properties" || link === "/About"){
                link.preventDefault();
                loading.style.display = "flex"
            }
        }

        return linkreload;
    }, [])

    return (
        <div>
            <div id="loader" setloading={setloading} className='text-center fixed top-0 left-0 w-full h-full bg-[#ffffffcc] justify-center z-100'>
                <img src={"./assets/temple-loader.gif"} alt="loader" />
            </div>
        </div>
    )
}

export default Loader
